import React from "react";
import Button from "./common/Button";

const Pagination = ({ currentPage, totalPages, onPageChange }) => {
    return (
        <div className="pagination">
            <Button btnText="Previous" disabled={currentPage === 1} btnClickHandler={() => onPageChange(currentPage - 1)} />
            <span className="">
                Page {currentPage} of {totalPages}
            </span>
            <Button className="btn-primary" btnText="Next" disabled={currentPage === totalPages} btnClickHandler={() => onPageChange(currentPage + 1)} />
        </div>
    );
};

export default Pagination;
